INSERT INTO `films` (`id`, `content`, `episode_current`, `episode_total`, `time`, `name`, `origin_name`, `poster_url`, `slug`, `status`, `thumb_url`, `time_film`, `type`, `view`, `year`) VALUES
(2, 'Vào đầu mùa thu năm 2012, một trường trung học phổ thông trọng điểm của thành phố Z mở kì thi tuyển học sinh mới, Tô Tại Tại đã trúng tuyển và được bước chân vào ngôi trường. Vào ngày đầu tiên đi học, Trương Lục Nhượng đã thu hút sự chú ý của Tô Tại Tại, khiến cô đã “Yêu ngay từ cái nhìn đầu tiên”. Nhờ sự ấm áp như ánh mặt trời của mình, Tô Tại Tại đã giúp Trương Lục Nhượng thoát khỏi sự tự ti. Còn Tô Tại Tại, người luôn đi theo số đông mà không biết kế hoạch, mục tiêu của mình là gì, dưới tác động của học bá Trương Lục Nhượng, cô dần dần hiểu ra cách lập kế hoạch và mục tiêu cho cuộc đời mình. Câu chuyện cho ta thấy ý nghĩa của sự thiếu hiểu trong tuổi trẻ và dần từ từ tiến đến một tương lai tươi sáng, tốt đẹp hơn.', 'Hoàn Tất (24/24)', '24', '2024-11-10 10:15:27.000000', 'Khi Anh Chạy Về Phía Em', 'When I Fly Towards You', 'https://phimimg.com/upload/vod/20230929-1/a6110983f8de490e116383020adc4662.jpg', 'khi-anh-chay-ve-phia-em', 'Hoàn thành', 'https://phimimg.com/upload/vod/20230929-1/e7e0790c8f05fe27a758d37bf5c1fd90.jpg', '30 phút/tập', 'series', 3100, 2020),
(5, 'Số phận thử thách tình yêu của một cặp đôi khi chiến tranh chia cắt họ. Nhưng nỗ lực của họ để được ở bên nhau một lần nữa giúp xóa nhòa ranh giới giữa người sống và người chết.', 'Tập 24', '30', '2024-11-15 22:04:27.000000', 'Truyền Thuyết Nàng Nak', 'The Legend Of Nang Nak', 'https://phimimg.com/upload/vod/20241101-1/1136354cdbbf84932f05dfe657897781.jpg', 'truyen-thuyet-nang-nak', 'ongoing', 'https://phimimg.com/upload/vod/20241101-1/2080529c4b4a19ba9a7c5328fa1d276b.jpg', '46 phút/tập', 'series', 1000, 2024),
(6, 'Gia Đình Darim (Iron Family) là câu chuyện về tình yêu và xung đột trong một gia đình, mở ra cơ hội để khán giả suy ngẫm về ý nghĩa của gia đình trong xã hội hiện đại. Với sự tham gia của các diễn viên hàng đầu như 김정현, 금새록, 최태준, 양혜지, phim mang lại cái nhìn sâu sắc về các mối quan hệ gia đình. Đạo diễn tài năng Sung Joon-hae đã tạo nên một bức tranh sống động về cuộc sống gia đình thông qua Iron Family.', 'Tập 15', '36', '2024-11-17 21:48:30.000000', 'Gia Đình Darim', 'Iron Family', 'https://phimimg.com/upload/vod/20241008-1/a98f562015459671da8ad0a9b66acc8f.jpg', 'gia-dinh-darim', 'ongoing', 'https://phimimg.com/upload/vod/20241008-1/33dd4ecd6efc1081209afebf7285ae44.jpg', '70 phút/tập', 'series', 1000, 2024),
(7, 'Phim chủ yếu xoay quanh nhân vật Cố Xuyên (Nhậm Gia Luân) từng là một thanh niên vui vẻ, đam mê cuộc sống nhưng lại trở thành &quot;xác chết&quot; biết đi do gặp tai nạn ô tô dẫn đến tổn thương tim nghiêm trọng. Dù đã trải qua ca ghép tim nhưng Cố Xuyên không thể thực hiện các bài tập vận động mạnh cũng như cảm xúc mãnh liệt như trước kia.Vì chỉ có thể sống dựa vào trái tim nhân tạo nên cuộc sống của anh mất đi sự vui vẻ tươi tắn trước đó. Thay vào đó, anh dần trở nên bi quan, thờ ơ với cuộc sống.', 'Hoàn Tất (36/36)', '36', '2024-11-17 21:54:13.000000', 'Tiểu Thư Quạ Đen Và Tiên Sinh Thằn Lằn', 'Miss Crow With Mr. Lizard', 'https://phimimg.com/upload/vod/20241117-1/fa200c5daee565373424c6cca2a61a5b.jpg', 'tieu-thu-qua-den-va-tien-sinh-than-lan', 'completed', 'https://phimimg.com/upload/vod/20241117-1/d9fb042360a3a8987ce0b026e648d864.jpg', '45 phút/tập', 'series', 1000, 2021),
(8, 'Nội dung phim xoay quanh những cuộc tranh đấu quyền lực và tình yêu của những nữ nhân trong chốn thâm cung vào triều đại Hoàng đế Ung Chính Nhà Thanh. Các phi tần lập mưu, tranh đấu nhau để có được quyền lực cũng như sự sủng ái của Hoàng đế.\r\n\r\nChân Hoàn là một thiếu nữ hiền lành, không màng danh lợi, thế sự, thế nhưng luôn bị hãm hại bởi những thế lực trong hậu cung. Hoàn cảnh buộc cô phải cứu lấy bản thân mình để rồi sau này cô trở thành phi tần quyền lực bậc nhất trong chốn hậu cung, nhưng điều gì cũng có cái giá của nó, để bước lên bảo tọa Hoàng thái hậu, Chân Hoàn vì mất dần những người thân yêu bên cạnh mình nên trở thành người phụ nữ tự cường, quyền lực, ra tay phòng thủ trước những âm mưu của người khác.', 'Hoàn Tất (76/76)', '76', '2024-11-17 22:00:54.000000', 'Hậu Cung Chân Hoàn Truyện', 'Empresses In The Palace', 'https://phimimg.com/upload/vod/20241117-1/7ca2671c6ba20c87b7e23f25d4f19497.jpg', 'hau-cung-chan-hoan-truyen', 'completed', 'https://phimimg.com/upload/vod/20241117-1/429427872cb94a010d842304022cfe7a.jpg', '45 phút/tập', 'series', 1000, 2021),
(9, 'Phim kể về hành trình của bà Lệ, người làm nghề vớt xác người chết trên sông để đưa về với gia đình. Trong quá trình làm nghề, bà Lệ đắc tội với Ma Da, một oan hồn sống dưới sông nước thường xuyên kéo chân người để thế mạng cho mình đi đầu thai. n oán của cả hai khiến cho Ma Da bắt mất bé Nhung, con gái của bà Lệ . Bà Lệ phải nhờ đến sự giúp đỡ của những người bên cạnh để cùng nhau lên đường tìm cách cứu bé Nhung và mở ra những bí mật đằng sau oan hồn Ma Da kia.', 'Full', '1', '2024-11-18 11:20:06.000000', 'Ma Da', 'The Drowning Spirit', 'https://phimimg.com/upload/vod/20241116-1/e851bfbfc2dc5b2f9463571e5fba6734.jpg', 'ma-da', 'completed', 'https://phimimg.com/upload/vod/20241116-1/3747ec0cb2bbc3679512ef163621eefc.jpg', '95 phút', 'single', 100, 2024),
(10, 'Một nhiếp ảnh gia bồn chồn rời bỏ gia đình để &quot;tìm lại chính mình&quot; và bắt đầu lặn biển sâu.', 'Full', '1', '2024-11-18 11:20:39.000000', 'Lặn Trong Biển Sâu', 'Diving', 'https://phimimg.com/upload/vod/20241116-1/e93f8d7187a23462e4a85ac1e0a280be.jpg', 'lan-trong-bien-sau', 'completed', 'https://phimimg.com/upload/vod/20241116-1/de7db64a39ee5688a8a2e1a79bc31c14.jpg', '102 phút', 'single', 100, 2024),
(11, 'Phim kể về hành trình của bà Lệ, người làm nghề vớt xác người chết trên sông để đưa về với gia đình. Trong quá trình làm nghề, bà Lệ đắc tội với Ma Da, một oan hồn sống dưới sông nước thường xuyên kéo chân người để thế mạng cho mình đi đầu thai. n oán của cả hai khiến cho Ma Da bắt mất bé Nhung, con gái của bà Lệ . Bà Lệ phải nhờ đến sự giúp đỡ của những người bên cạnh để cùng nhau lên đường tìm cách cứu bé Nhung và mở ra những bí mật đằng sau oan hồn Ma Da kia.', 'Full', '1', '2024-11-18 11:21:30.000000', 'Bài Học Tình Yêu', 'Love Lesson', 'https://phimimg.com/upload/vod/20241116-1/9591075a6ee88e708490f03c5eb58458.jpg', 'bai-hoc-tinh-yeu', 'completed', 'https://phimimg.com/upload/vod/20241116-1/fdff9d5b80aaf56c97723884605d22d3.jpg', '80 phút', 'single', 100, 2013),
(12, 'Bộ phim kể về câu chuyện gia đình March ở Concord, bang Massachussette, trong cuộc nội chiến. Người cha ra ngoài mặt trận, ở nhà chỉ còn Marmee cùng bốn cô con gái: Meg- cô chị cả rất &quot;người lớn&quot;, Jo - cô em thứ hai nghịch ngợm như con trai và mơ ước trở thành một nhà văn trong tương lai, Beth- cô em thứ ba yếu đuối và dịu dàng và Amy- cô em út điệu đàng và rất có tài hoạ sĩ. Họ kết bạn với cậu con trai Laurie nhà bên và đã cùng nhau có những tháng ngày vất vả nhưng thật hạnh phúc. Rồi nhiều đổi thay đã diễn ra trong gia đình March, mỗi người đi một phương, nhưng cuối cùng họ đều nhận ra rằng: gia đình là nơi bình yên và đẹp đẽ nhất trong tâm hồn họ.', 'Full', '1', '2024-11-18 11:24:44.000000', 'Những Người Phụ Nữ Bé Nhỏ', 'Little Women', 'https://phimimg.com/upload/vod/20241116-1/e851bfbfc2dc5b2f9463571e5fba6734.jpg', 'nhung-nguoi-phu-nu-be-nho-2019', 'completed', 'https://phimimg.com/upload/vod/20241116-1/3747ec0cb2bbc3679512ef163621eefc.jpg', '135 phút', 'single', 200, 2020),
(13, 'TPB AFK: The Pirate Bay Away From Keyboard là một bộ phim tài liệu Thụy Điển năm 2013 do Simon Klose đạo diễn và sản xuất. Nó tập trung vào cuộc sống của ba người sáng lập The Pirate Bay - Peter Sunde, Fredrik Neij, và Gottfrid Svartholm - và phiên tòa xét xử Pirate Bay.', 'Full', '1', '2024-11-18 11:25:23.000000', 'Vịnh Hải Tặc AKF', 'TPB AFK The Pirate Bay Away From Keyboard', 'https://phimimg.com/upload/vod/20241116-1/098126090ec75346e811ae3882f07c6e.jpg', 'vinh-hai-tac-akf', 'completed', 'https://phimimg.com/upload/vod/20241116-1/852fa13905abcacc7957fc75eefd1aae.jpg', '82 phút', 'single', 100, 2013),
(14, 'Địch Nhân Kiệt nhận lệnh tuần tra các con đường ở Giang Nam. Khi đi qua thành Lâm An, ông bị cuốn vào một vụ án các thiếu nữ mất tích bí ẩn. Qua quá trình điều tra sâu rộng, ông phát hiện vụ án có liên quan đến một tà giáo dâm ô tại địa phương. Vụ án đầy rẫy những nghi ngờ, phức tạp và đằng sau là bóng dáng mờ ảo của yêu tăng. Bằng trí tuệ phi thường, Địch Nhân Kiệt dần dần lần ra từng manh mối, từng bước tiến gần đến sự thật, mở ra một cuộc hành trình điều tra nơi chính nghĩa và tà ác đối đầu nhau.', 'Full', '1', '2024-11-18 11:25:51.000000', 'Địch Nhân Kiệt: Đoạt Mệnh Yêu Tăng', 'Detective Di Renjie: The Deadly Monk', 'https://phimimg.com/upload/vod/20241115-1/f88dbc464d0e887c29057dbebd0fd3ef.jpg', 'dich-nhan-kiet-doat-menh-yeu-tang', 'completed', 'https://phimimg.com/upload/vod/20241115-1/d22dd5a145af18a31c46569ffe66298e.jpg', '80 phút', 'single', 100, 0),
(15, 'Sau khi máy bay rơi, bốn đứa trẻ bản địa dựa vào kiến thức truyền đời để nỗ lực sinh tồn giữa rừng Amazon ở Colombia trong khi một nhiệm vụ giải cứu chưa từng thấy đang diễn ra.', 'Full', '1', '2024-11-18 11:26:25.000000', 'Những Đứa Trẻ Mất Tích Ở Amazon', 'The Lost Childrenn', 'https://phimimg.com/upload/vod/20241116-1/e851bfbfc2dc5b2f9463571e5fba6734.jpg', 'nhung-dua-tre-mat-tich-o-amazon', 'completed', 'https://phimimg.com/upload/vod/20241116-1/3747ec0cb2bbc3679512ef163621eefc.jpg', '95 phút', 'single', 100, 2024),
(16, 'Chiếc khăn ma thuật của một góa phụ trẻ biến một người tuyết đẹp trai thành người thật. Liệu anh có thể giúp cô tìm lại tình yêu, tiếng cười và niềm vui dịp lễ trước khi tan chảy?', 'Full', '1', '2024-11-18 11:26:48.000000', 'Chàng Người Tuyết Của Em', 'Hot Frosty', 'https://phimimg.com/upload/vod/20241114-1/4102a2ca2a6c0e2d455c3285793ef8b7.jpg', 'chang-nguoi-tuyet-cua-em', 'completed', 'https://phimimg.com/upload/vod/20241114-1/a2abc6e2e5f8d0ec10457b2f45548654.jpg', '90 phút', 'single', 100, 2024),
(17, 'Phim xoay quanh cuộc sống của Kaiji tại Tokyo trong thời điểm khó khăn về kinh tế. Bởi không thể tìm được một công việc nghiêm túc, Kaiji bắt đầu đắm chìm vào cờ bạc và trở thành một con nợ đầy tai tiếng. Một ngày nọ, một kẻ thu nợ có tên là Endo đã tìm Kaiji và đưa cho anh ta hai sự lựa chọn: hoặc lao động khổ sai trong vòng 10 năm hoặc tham gia những trò cờ bạc trong một đêm để kiếm được số tiền hoàn nợ.', 'Full', '1', '2024-11-18 11:27:17.000000', 'Thần Bài Kaiji 3: Trận Quyết Tử', 'Kaiji: Final Game', 'https://phimimg.com/upload/vod/20241114-1/919714bb72d3231d431ba0dc8504f989.jpg', 'than-bai-kaiji-3-tran-quyet-tu', 'completed', 'https://phimimg.com/upload/vod/20241114-1/20469548c3f69df1181e4ae7b1eea892.jpg', '128 phút', 'single', 100, 2024),
(18, 'Phần 2 của phim được tiếp tục khi Kaiji lại rơi vào con đường túng quẫn và bị bắt xuống cống làm việc. Tại đây anh đã thỏa thuận với công ty quản lý của mình về việc cho anh lên mặt đất và kiếm được số tiền 200 triệu Yên từ 1 triệu Yên ban đầu trong vòng 14 ngày. Kaiji sẽ làm gì để có thể “làm giàu” trong thời gian quá ngắn như thế?', 'Full', '1', '2024-11-18 11:27:45.000000', 'Thần Bài Kaiji 2: Con Bạc Cuối Cùng', 'Kaiji 2: The Ultimate Gambler', 'https://phimimg.com/upload/vod/20241114-1/3b803edb4fb8d9f78b7ffb4140fe5160.jpg', 'than-bai-kaiji-2-con-bac-cuoi-cung', 'completed', 'https://phimimg.com/upload/vod/20241114-1/acfcfd91feeeef37d0e8606d42e7b20d.jpg', '133 phút', 'single', 100, 2024),
(19, 'Sau khi tốt nghiệp THPT, Kaiji Ito (Fujiwara Tatsuya) chuyển tới Nhật Bản. Không thể nào tìm được việc làm, cộng với bất mãn xã hội, cậu lao vào đánh bạc, rượu chè và phá hoại. Sau 2 năm bê tha, 1 gã đòi nợ tên Endo (Amami Yuki) đến gặp cậu để thu tiền. Gã cho Kaiji 2 lựa chọn: một là dùng cả 10 năm làm việc quần quật để trả nợ, hoặc là tham gia vào trò bạc trên 1 con tàu trong chỉ 1 đêm để thanh toán hết nợ nần và thậm chí còn có thể kiếm được nhiều hơn nữa. Thực ra, gã Endo đó đã chơi trò nhập nhằng 2 mặt, gã điều khiển Kaiji nhưng lại hoàn toàn cho rằng cậu không thể có đường về sau chuyến đi đó. Và rồi Kaiji bước vào đêm định mệnh của mình...', 'Full', '1', '2024-11-18 11:28:06.000000', 'Thần Bài Kaiji', 'Kaiji: The Ultimate Gambler', 'https://phimimg.com/upload/vod/20241114-1/c2e02b4032dd1a36d72801cae5e80959.jpg', 'than-bai-kaiji', 'completed', 'https://phimimg.com/upload/vod/20241114-1/930f6646c3b8b32bcb390df21466fd1f.jpg', '130 phút', 'single', 100, 2024),
(20, 'Đường Đua Nghẹt Thở là câu chuyện có thật về hai tay đua huyền thoại: Niki Lauda và James Hunt. Thế nhưng còn hơn thế nữa, đây là sự đối đầu của hai tính cách, một cuộc đối đầu vĩ đại nhưng bên trong nó là một tình bạn cao thượng (friendemy).Niki Lauda là huyền thoại của làng đua xe. Bộ dạng như một con chuột, Niki là con người thực dụng, sử dụng kinh nghiệm và sự tính toán đầu óc trên đường đua (bản thân anh cũng là một thiên tài cơ khí và tự hào với một bộ mông trời phú &quot;chỉ cần ngồi lên là biết xe thế nào&quot;). Anh tới với F1 chỉ vì, theo tính toán logic của anh, đó là công việc mà anh làm giỏi nhất và sẽ thành công nhất (&quot;nếu có việc khác có thể thành công hơn, tôi sẽ bỏ đua xe ngay). Phương châm của Niki là chấp nhận rủi ro đến 20%, nhưng ...', 'Full', '1', '2024-11-18 11:28:32.000000', 'Đường Đua Nghẹt Thở', 'Rush', 'https://phimimg.com/upload/vod/20241114-1/a868b49a5aeb34b6b4e8081d915e1175.jpg', 'duong-dua-nghet-tho', 'completed', 'https://phimimg.com/upload/vod/20241114-1/e239d43e6400f09c7891cb77bcb89e64.jpg', '123 phút', 'single', 100, 2013),
(21, 'Được chuyển thể từ tác phẩm hoạt hình nổi tiếng, Liệt Diễm Chi Vũ Canh Kỷ kể về câu chuyện của hoàng tử nhân tộc Ngũ Canh. Phải chịu cảnh nước mất nhà tan và trở thành nô lệ, Ngũ Canh luôn ôm trong lòng khát vọng báo thù cho cha mẹ và nhân tộc. Dựa vào ý chí kiên cường của mình, anh dốc hết sức mình luyện tập, vượt qua nhiều khó khăn khác nhau để thực hiện kế hoạch trả thù và tìm kiếm sự tự do.', 'Hoàn Tất (40/40)', '40', '2024-11-18 11:47:34.000000', 'Liệt Diễm Chi Vũ Canh Kỷ', 'Burning Flames', 'https://phimimg.com/upload/vod/20240310-1/9c9414cdff091e5f4acf517f0103d125.jpg', 'liet-diem-chi-vu-canh-ky', 'completed', 'https://phimimg.com/upload/vod/20240310-1/b15b077200fbc0a0c4f3ac4c1f2c6275.jpg', '45 phút/tập', 'series', 1000, 2024),
(22, 'Cô nàng Su Jeong mạnh mẽ và anh chàng Eui Ju keo kiệt sẽ có những màn trả thù hài hước.', 'Hoàn Tất (124/124)', '124', '2024-11-18 11:47:34.000000', 'Yong Soo-jung Dũng Cảm', 'The Brave Yong Su Jeong', 'https://phimimg.com/upload/vod/20241010-1/005b0d8760f33a6a88725e434c37b282.jpg', 'yong-soojung-dung-cam', 'completed', 'https://phimimg.com/upload/vod/20241010-1/15c846560db6991683bff7b40bf46549.jpg', '30 phút/tập', 'series', 1100, 2024),
(23, 'Hôn ước của Khang Bảo Kỳ và Tưởng Kiều (do Nhạc Hoa đóng) không thành do năm đó bất chợt xảy ra một trận thiên tai. Nhìn thấy cảnh dân đói lầm than, cha của Bảo Kỳ quyết định giấu Vua mở kho lương thực để cứu tế. Vì thế, cả gia đình nhà họ Khang đều bị xử trảm, duy chỉ có Bảo Kỳ sống sót. Từ đó, cô lưu lạc khắp nơi để tránh khỏi sự truy sát của triều đình.Sau nhiều năm lang bạt, Bảo Kỳ cuối cùng cũng gặp lại vị hôn phu của mình. Tưởng Kiều của ngày nào nay đã trở thành vua gạo. Tuy công việc thuận lợi nhưng chuyện nhà của Tưởng Kiều lại rối ren. Khi biết Bảo Kỳ còn sống, Tưởng Kiều ra sức che chở cho cô, tiếp tục mối duyên xưa. Không bao lâu sau, Bảo Kỳ trở thành tứ phu nhân của Tưởng gia.Từ khi bước chân vào Tưởng gia, Bảo Kỳ luôn bị đại phu nhân Ân Phụng Nghi (do Tạ Tuyết Tâm đóng) và nhị phu nhân Bành Kiều (do Thương Thiên Nga đóng) hãm hại, lại thêm Tam phu nhân Lưu Phương (do Huệ Anh Hồng đóng) nhút nhát luôn hùa theo hai người chị.', 'Tập 12', '25', '2024-11-18 11:47:35.000000', 'Xứng Danh Tài Nữ (Phần 4)', 'Rosy Business (Season 4)', 'https://phimimg.com/upload/vod/20241106-1/690e1b2b1721973e4f26e06129272126.jpg', 'xung-danh-tai-nu-phan-4', 'ongoing', 'https://phimimg.com/upload/vod/20241106-1/9acdc1497c0d58d7eae3cabd1ed55abd.jpg', '45 phút/tập', 'series', 1000, 2024),
(25, 'Jeong In được phát hiện đã chết, cầm trên tay một mảnh giấy báo trước cái chết của cô. Trong quá khứ, cô và Min Tae Chang đã âm mưu giết cha của Baek Seol Ah và cướp đi tài sản của ông. Sau khi sử dụng số tiền trộm được để trở thành CEO của một công ty sản xuất mà cô thành lập, cô gặp và yêu Seo Jin Ho, một diễn viên đầy tham vọng có ngoại hình giống hệt mối tình đầu của cô. Jeong In biến anh thành Jung Woo Jin, một ngôi sao hàng đầu. Tuy nhiên, cô biết được rằng tình cũ của anh là Baek Seol Ah và Park Jin Kyung, tác giả chưa được tiết lộ của &quot;Poker Face&quot;, cũng chính là Baek Seol Ah. Baek Seol Ah thề sẽ trả thù sau khi biết rằng bạn trai cũ của cô, Seo Jin Ho, có quan hệ với Jeong In, kẻ đã sát hại cha cô. Cô quyết tâm viết một vở kịch để hoàn thành cuộc trả thù của mình. Baek Seol Ah có thể là kẻ sát hại Moon Jeong In? Thủ phạm là người có mặt trong phòng tiệc nhưng ai cũng cầu mong cho Jeong In cái chết. Đó là ai và vì lý do gì họ giết cô ấy?', 'Tập 92', '100', '2024-11-18 11:47:35.000000', 'Sự Trả Thù Của Nàng Bạch Tuyết', 'Snow White\'s Revenge', 'https://phimimg.com/upload/vod/20241003-1/97e19e6a4261278ddd5fa8f4da5c4e49.jpg', 'su-tra-thu-cua-nang-bach-tuyet', 'ongoing', 'https://phimimg.com/upload/vod/20241003-1/d6f433448d085c9f10f3ed52daf94f95.jpg', '33 phút/tập', 'series', 1200, 2024),
(26, 'Dư Mãn Nguyệt là người phụ trách quan hệ công chúng, một chuyên gia xử lý khủng hoảng truyền thông cho các tập đoàn lớn. Trước mặt mọi người, Nguyệt tài sắc vẹn toàn, nhưng thâm sâu, cô có một ký ức đáng sợ. Mười tám năm trước, cô và em gái bị con trai thương gia Tưởng Triết Hiền là Tưởng Cơ Tuấn xâm hại. Gia đình vì thế mà gặp biến cố lớn, cha mẹ bị hại, em gái tàn tật, chị gái cũng bỏ nhà đi. Nỗi đau chồng chất, Nguyệt thề sẽ trả thù. Nhẫn nại suốt mười tám năm, cuối cùng Dư Mãn Nguyệt thành công phơi bày tội ác của cha con nhà họ Tưởng, khiến nhà họ Tưởng suy sụp và đưa những người tham gia vào vòng pháp luật. Đồng thời, trên hành trình báo thù, Nguyệt đã quen biết chuyên gia chứng khoán Thành Phong và dần nảy sinh tình cảm với anh. Hạnh phúc chưa lâu, Dư Mãn Nguyệt lại phát hiện kẻ chủ mưu thực sự chính là người bạn cũ, Trác Tuệ Vân. Hận thù trong lòng quá lớn, Nguyệt thỉnh cầu Phong tiếp cận Vân, lừa gạt cô ta đến chỗ trắng tay…', 'Tập 16', '25', '2024-11-20 22:26:21.000000', 'Hắc Sắc Nguyệt Quang', 'Darkside Of The Moon', 'https://phimimg.com/upload/vod/20241030-1/99a35df46ed033bf01fa0fd98948a91e.jpg', 'hac-sac-nguyet-quang', 'ongoing', 'https://phimimg.com/upload/vod/20241127-1/83ae85a2ef3a378d756ca6e79af9344b.jpg', '43 phút/tập', 'series', 1000, 0),
(27, 'Mười nghìn năm trước khi Paul Atreides thăng thiên, hai chị em Valya và Tula Harkonnen đã thành lập giáo phái huyền thoại và trật tự nữ giới được gọi là Bene Gesserit để kiểm soát tương lai của loài người.', 'Tập 1', '6', '2024-11-20 23:02:16.000000', 'Hành Tinh Cát: Lời Tiên Tri', 'Dune: Prophecy', 'https://phimimg.com/upload/vod/20241118-1/f490c695998243e5586896a50a7b19ab.jpg', 'hanh-tinh-cat-loi-tien-tri', 'ongoing', 'https://phimimg.com/upload/vod/20241118-1/58ed7c8aadd9c6ee185b7875ce499a6b.jpg', '65 phút/tập', 'series', 10000, 2024),
(28, 'War of Y được chia thành bốn câu chuyện về những cuộc đấu tranh trong ngành giải trí. Câu chuyện 1- Con tàu mới Trước con tàu, mọi chuyện không hề dễ dàng. Nhưng thời đại mới này thậm chí còn khó khăn hơn. Chuyện 2 - Cuộc Chiến Của Các Nhà Quản Lý Câu chuyện về một cặp vợ chồng chuyển tàu vốn là một cặp đôi thực sự. Quản lý và kịch xung đột cho đến khi cặp đôi buộc phải chia tay. Câu chuyện 3 - Y-Idol Một cuộc tìm kiếm thực tế các diễn viên mới—những người có thể hát, nhảy và diễn xuất—và sự hỗn loạn của Idol Camp. Câu chuyện 4 - Vợ Khi một nửa của cặp vợ chồng tàu biển có vợ, liệu tương lai của họ trong ngành này có bị hủy hoại?', 'Hoàn Tất (20/20)', '20', '2024-11-20 23:02:16.000000', 'Cuộc Chiến Y', 'War Of Y', 'https://phimimg.com/upload/vod/20241118-1/a77236358a72268561ff139064432f62.jpg', 'cuoc-chien-y', 'completed', 'https://phimimg.com/upload/vod/20241118-1/a8f987f79e18b117a1ca206e63cc948d.jpg', '58 phút/tập', 'series', 1000, 2022),
(29, 'Narcos: Mexico sẽ khám phá nguồn gốc của cuộc chiến ma túy hiện đại bằng cách quay trở lại thời điểm khi giới buôn hàng trắng Mexico chỉ mới là một liên minh lỏng lẻo và vô tổ chức của những người trồng và buôn bán thuốc phiện nhỏ lẻ. Bộ phim sẽ nói về sự nổi lên của Cartel Guadalajara trong những năm 1980 khi Félix Gallardo (Diego Luna) nắm quyền lãnh đạo, thống nhất những tay buôn để tạo nên một đế chế.', 'Hoàn Tất (10/10)', '10', '2024-11-20 23:02:16.000000', 'Trùm Ma Túy: Mexico (Phần 1)', 'Narcos: Mexico (Season 1)', 'https://phimimg.com/upload/vod/20241118-1/597bfeccbd4578cdbb3ca87e5b9a737a.jpg', 'trum-ma-tuy-mexico-phan-1', 'completed', 'https://phimimg.com/upload/vod/20241118-1/8907a5944e2cf4c77625837f4b186124.jpg', '58 phút/tập', 'series', 1000, 2018),
(30, 'Chuyện gia đình trở nên quái dị khi cặp cha mẹ Fred và Deloris săn lùng sinh vật siêu nhiên còn cặp song sinh Viv và Geoff che giấu những bí mật kỳ lạ của riêng mình.', 'Hoàn tất (10/10)', '10', '2024-11-20 23:02:16.000000', 'Gia đình thợ săn quỷ', 'October Faction', 'https://phimimg.com/upload/vod/20241118-1/1ac7314728e496131848060a0c9a4c74.jpg', 'gia-dinh-tho-san-quy', 'completed', 'https://phimimg.com/upload/vod/20241118-1/8737cb85ce356d422f511196e471858a.jpg', '40 phút/tập', 'series', 1000, 2020),
(31, 'Nữ doanh nhân kiên định loay hoay giữa mối tình tay ba giữa chàng trai trẻ quyến rũ và người giám đốc hơn tuổi. Từ đây, cô bước vào con đường tình yêu trái lẽ thường.', 'Hoàn Tất (41/41)', '41', '2024-11-20 23:02:16.000000', 'Trạm Kế Tiếp Là Hạnh Phúc', 'Find Yourself', 'https://phimimg.com/upload/vod/20241118-1/a5982f8dd14e171e03a60ca7704a650c.jpg', 'tram-ke-tiep-la-hanh-phuc', 'completed', 'https://phimimg.com/upload/vod/20241118-1/0530519fdc3b38c1c4b42931673f69e3.jpg', '45 phút/tập', 'series', 1000, 2020),
