(37, 'Nhà văn Hồng Kông Thiên Vũ một mình đến Đài Bắc để tìm kiếm Vịnh Cá Voi - địa danh bí ẩn mà theo một người bạn qua thư của anh chàng viết là có thể dẫn lối đến thiên đường. Trong chuyến đi, anh bất ngờ gặp A Tường - anh chàng địa phương tốt bụng và đem đến nhiều cảm xúc cho Thiên Vũ. Dù hẹn ước sẽ cùng nhau đi tìm Vịnh Cá Voi, nhưng A Tường lại đột nhiên biến mất kể từ Lễ hội pháo hoa Kenting. Nhận ra cuộc gặp gỡ trước đó giữa mình và A Tường chính là định mệnh, Thiên Vũ quyết tâm đi tìm A Tường và luôn mong ngày gặp lại chàng trai ấy.', 'Full', '1', '2024-11-21 08:01:48.000000', 'Chờ Người Nơi Pháo Hoa Rực Rỡ', 'A Balloon\'s Landing', 'https://phimimg.com/upload/vod/20241109-1/ab91cf6b6630f8334bbb0f98d58071b3.jpg', 'cho-nguoi-noi-phao-hoa-ruc-ro', 'completed', 'https://phimimg.com/upload/vod/20241109-1/5223050570ff9a6c2d07246ce5cd789e.jpg', '101 phút', 'single', 1000, 2024),
(38, 'Joan là một cô gái 16 tuổi ngây thơ và dễ yêu. Một ngày nọ, anh quyết định trốn đến các tỉnh cùng với Luciana, một phụ nữ 35 tuổi xinh đẹp và là giáo viên ở trường anh, để được tự do kiềm chế tình yêu của mình. Chẳng bao lâu, Joan kinh hoàng phát hiện ra rằng cô đã rơi vào một cái bẫy đan xen giữa tình dục, tiền bạc, chính trị và bạo lực.', 'Full', '1', '2024-11-21 08:01:48.000000', 'Kẻ Cướp Tình Yêu', 'Amor Bandido', 'https://phimimg.com/upload/vod/20241109-1/2967eabc2e333e0437a53ea5ad8a46c9.jpg', 'ke-cuop-tinh-yeu', 'completed', 'https://phimimg.com/upload/vod/20241109-1/24f3495e3fcee9bf33d31a9611c82192.jpg', '80 phút', 'single', 1000, 2021),
(39, 'Ken Park tập trung vào một số thanh thiếu niên và cuộc sống gia đình đau khổ của họ. Shawn dường như là thông thường nhất. Tate tràn ngập cơn thịnh nộ tâm thần; Claude thường xuyên bị quấy rối bởi người cha tàn bạo của mình và được nuông chiều khá khó chịu bởi người mẹ đang mang thai to lớn của mình. Peaches chăm sóc người cha sùng đạo của cô, nhưng lại khao khát tự do. Tất cả đều khá chặt chẽ, hoặc vì vậy họ tuyên bố.', 'Full', '1', '2024-11-21 08:01:48.000000', 'Tuổi Dậy Thì', 'Ken Park', 'https://phimimg.com/upload/vod/20231212-1/1b22d2a54d32cae00e51448a00b0dc0d.jpg', 'tuoi-day-thi', 'completed', 'https://phimimg.com/upload/vod/20231212-1/e14a7b42d315a6d39462f1b045340b3f.jpg', '97 phút', 'single', 1000, 2002),
