(48, 'Chuyển thể từ tiểu thuyết cùng tên, câu chuyện kể về vị chúa tể tối cao xa cách của vô vàn cõi giới. Ông ta tuyển chọn những cô gái trẻ, mỗi người đều có tiềm năng trở thành những vị thần tương lai, và bắt đầu một nhiệm vụ gian nan để định hình lại vận mệnh của các cõi giới. Đối mặt với những thách thức và trở ngại to lớn, liệu những cô gái trẻ này có chiến thắng trong thử thách của mình và tạo nên một thế giới mới từ đống tro tàn của thế giới cũ?', 'Tập 9', '12', '2024-11-21 08:07:20.000000', 'Đồ Đệ Của Ta Đều Là Đại Lão', 'Apprentices Are All Bosses', 'https://phimimg.com/upload/vod/20241101-1/7ccee1c6d7e9b20216492dd6e64093b2.jpg', 'do-de-cua-ta-deu-la-dai-lao', 'ongoing', 'https://phimimg.com/upload/vod/20241101-1/135a7a8bc58165077aefed1c4e376477.jpg', '12 phút/tập', 'hoathinh', 1100, 2024),
(49, 'Amakawa Haruto, một sinh viên bị tai nạn chết đi trong khi vẫn nặng lòng về mối tình đầu thuở ấu thơ với Ayase Miharu. Hắn được chuyển sinh sang một thế giới khác sống với thân phận Rio nhưng vẫn lưu giữ ký ức của tiền kiếp.\r\n\r\nMột thế giới huyền ảo khắc nghiệt, Rio mồ côi mang theo mối thù giết mẹ, một ngày nọ có một cô công chúa bị bắt cóc, hắn vô tình giải cứu được cô nàng và từ đó cuộc đời Rio đã rẽ sang một bước ngoặt hoàn toàn mới.', 'Hoàn tất (12/12)', '12', '2024-11-21 08:17:40.000000', 'Tinh Linh Huyễn Tưởng Ký', 'Seirei Gensouki: Spirit Chronicles', 'https://phimimg.com/upload/vod/20241118-1/3c33bfb6752affa10364bcf137b9665d.jpg', 'tinh-linh-huyen-tuong-ky', 'completed', 'https://phimimg.com/upload/vod/20241118-1/e7572801c01ab66dd4c92e5a378ba7d5.jpg', '25 phút/ 1 tập', 'hoathinh', 1000, 2021),
(50, 'Nagumo Hajime là một đứa bị bắt nạt trong trường, cùng với bạn học cùng lớp bị triệu hồi thế giới khác. Mặc dù các bạn học lần lượt được ban cho siêu năng lực chiến đấu đặc biệt, nhưng Hajime chỉ được năng lực tầm thường của biến đổi sư. Hơn nữa, chàng đã yếu đuối nhất trong thế giới khác, lại bị bạn học đẩy rơi vào vực sâu mê cung!? Dưới vực sâu tuyệt vọng không tìm được biện pháp gì thoát khỏi, Hajime gặp gỡ quỷ hút máu Uki và lên đường trở thành người mạnh nhất thế giới với tư cách biến đổi sư...', 'Hoàn tất (15/15)', '15', '2024-11-21 08:17:40.000000', 'Arifureta: Từ Tầm Thường Đến Bất Khả Chiến Bại (Phần 2)', 'Arifureta: From Commonplace To World\'s Strongest (Season 2)', 'https://phimimg.com/upload/vod/20240403-1/59207f0d89e1a7950209219960dcb2cd.jpg', 'arifureta-tu-tam-thuong-den-bat-kha-chien-bai-phan-2', 'completed', 'https://phimimg.com/upload/vod/20240403-1/5e289b186eaafd6188b72c4410ffad04.jpg', '25 phút/ 1 tập', 'hoathinh', 1000, 0),
(51, 'Hajime Nagumo bị triệu hồi đến một thế giới khác cùng với các bạn cùng lớp của mình. Cậu bị đẩy và rơi xuống vực thẳm của mê cung bởi sự ác ý của một người bạn cùng lớp. Cậu vượt qua kẻ mạnh nhất trong khi tìm ra con đường trốn thoát. Thế giới tưởng tượng về kẻ mạnh nhất bắt đầu!', 'Hoàn tất (14/14)', '14', '2024-11-21 08:17:40.000000', 'Arifureta: Từ Tầm Thường Đến Bất Khả Chiến Bại (Phần 1)', 'Arifureta: From Commonplace To World\'s Strongest (Season 1)', 'https://phimimg.com/upload/vod/20240302-1/8abbfa7917fb52379b676b8bee7788ff.jpg', 'arifureta-tu-tam-thuong-den-bat-kha-chien-bai-phan-1', 'completed', 'https://phimimg.com/upload/vod/20240302-1/4f5c15a266bbb36b9c9188f0c5359d4d.jpg', '25 phút/ 1 tập', 'hoathinh', 1000, 0),
(52, 'Bộ phim lấy bối cảnh năm 2138 khi con người không còn phân biệt được đâu là thực đâu là ảo được nữa. Yggdrasil, một trò chơi trực tuyến nổi tiếng đã âm thầm bị đóng cửa trong quá khứ. Tuy nhiên một top-player tên Momonga đã quyết định sống chết cùng với trò chơi này và sau đó hắn đã trở thành một tên Cốt Bạch Hắc Ma có sức mạnh lớn nhất trong trò chơi này. Thế giới dần đổi thay, cho đến khi các NPC dần dần có cảm xúc của một con người. Không gia đình, không bạn bè, không việc làm hay chỗ đứng trong xã hội, hắn quyết định chiếm lấy thế giới này cho riêng mình.', 'Hoàn tất (13/13)', '13', '2024-11-21 08:21:48.000000', 'Lạc Vào Thế Giới Game (Phần 3)', 'Overlord (Season 3)', 'https://phimimg.com/upload/vod/20241116-1/5fe259f2ead7489d6025bf9451339127.jpg', 'lac-vao-the-gioi-game-phan-3', 'completed', 'https://phimimg.com/upload/vod/20241116-1/5e572ab28bda50d879eb6430cdb64dfc.jpg', '25 phút/ 1 tập', 'hoathinh', 1000, 2018),
