(54, 'Phim nói về hành trình của một nhóm người cùng nhau sinh tồn và cố gắng thoát khỏi sự truy đuổi của xác sống để đến chuyến phà cuối cùng tại một cù lao trên vùng hạ lưu sông Mekong khi đại dịch xác sống bùng nổ. Công - một thầy thuốc đông y nhưng đã mất đi niềm tin vào tình người, quyết định đưa cha mình và con gái tìm đường rời đi. Trong quá trình chạy trốn, họ thất lạc nhau, Công hoang mang đi tìm đứa con gái rồi vô tình gặp được một gia đình hiền lành, hai chàng trai ma lanh, đôi bạn trẻ lương thiện và một người đàn ông có trái tim dũng cảm. Họ cùng nhau hợp sức thành một nhóm chống trả để giành giật sự sống. Đúng lúc này, sự tị hiềm, tham lam, ích kỷ của lòng người nảy sinh và lại đẩy họ vào những thử thách sống còn. Liệu hành trình của nhóm người này sẽ đi về đâu khi đại dịch càng ngày càng lan rộng?', 'Full', '1', '2024-11-21 21:42:46.000000', 'Cù Lao Xác Sống', 'Lost In Mekong Delta', 'https://phimimg.com/upload/vod/20241121-1/ea578f7b02391a397cf03e8b030453ba.jpg', 'cu-lao-xac-song', 'completed', 'https://phimimg.com/upload/vod/20241121-1/a9ab75f9f717f64ef168fb2363238729.jpg', '93 phút', 'single', 1000, 2022),
