(76, 'Chương trình thực tế của EXO nơi họ đi du lịch vòng quanh thế giới và sử dụng thang để đưa ra quyết định.', 'Hoàn Tất (12/12)', '12', '2024-11-21 23:03:50.000000', 'EXO\'s Travel The World On A Ladder In Geoje & Tongyeong', 'EXO\'s Travel The World On A Ladder In Geoje & Tongyeong', 'https://phimimg.com/upload/vod/20241015-1/5154d9f1cf2a63eb85f7c40b3fa46249.jpg', 'exos-travel-the-world-on-a-ladder-in-geoje-tongyeong', 'completed', 'https://phimimg.com/upload/vod/20241015-1/dbb727888419c7001029d1bcff026657.jpg', '21 phút/tập', 'tvshows', 1000, 2023),
(77, 'Trong cuộc so tài nấu ăn khốc liệt giữa 100 thí sinh này, 80 đầu bếp yếu thế &quot;Thìa Đen&quot; có sở trường về hương vị đối đầu với 20 đầu bếp ưu tú &quot;Thìa Trắng&quot;.', 'Hoàn Tất (12/12)', '12', '2024-11-21 23:04:15.000000', 'Đại Chiến Tầng Lớp Ẩm Thực', 'Culinary Class Wars', 'https://phimimg.com/upload/vod/20240922-1/03ebeeae6a5f668c890539c59d064157.jpg', 'dai-chien-tang-lop-am-thuc', 'completed', 'https://phimimg.com/upload/vod/20240922-1/5d7bf572144c7061d2e71962801c3da9.jpg', '63 phút/tập', 'tvshows', 1000, 2024),
(78, 'Các công nhân bắt đầu làm việc chăm chỉ trong khi các thành viên tiến vào đế chế nịnh nhằm chiến thắng trái tim của Ông Trùm SOHEE. Một thành viên thậm chí còn tự xưng là cánh tay phải và lấy lòng Ông Trùm thành công bằng chiến lược xuất sắc, bất chấp sự phản đối từ các công nhân. Đó có thể là ai? Một mặt khác, Ông Trùm Đệ Nhất SOHEE quyết định tận hưởng bữa trưa và gọi một bàn đầy những món hải sản tươi ngon. Từ các món ăn kèm đến thực đơn cua hoàng đế và gỏi cá sống, các thành viên được tha hồ thưởng thức hương vị biển. Tuy nhiên, trong bữa trưa, ai nấy đều bị sốc khi nhiệm vụ ẩn được tiết lộ. Tất cả các thành viên bắt đầu trở nên hiếu thắng vì tham vọng quyền lực. Nhiệm vụ ẩn dẫn đến cuộc đối đầu trực diện cho vị trí Ông Trùm sẽ là gì?', 'Hoàn Tất (10/10)', '10', '2024-11-21 23:04:59.000000', 'Ông Trùm RIIZE', 'Boss Riize', 'https://phimimg.com/upload/vod/20241010-1/d8740ffc72fe5462c1c20d2ff03ad797.jpg', 'ong-trum-riize', 'completed', 'https://phimimg.com/upload/vod/20241010-1/dc50118f5eaa7f4e1cd94f3897c32705.jpg', '22 phút/tập', 'tvshows', 1000, 2024),
(79, 'Phim tài liệu nằm trong chuỗi chương trình Hộp nhạc, kể lại hành trình âm nhạc đầy màu sắc và cá tính của nghệ sĩ Jason Isbell.', 'Full', '1', '2024-12-12 21:33:44.000000', 'Hộp Nhạc Jason Isbell Nhắm Mắt Mà Chạy', 'Music Box Jason Isbell Running With Our Eyes Closed', 'https://phimimg.com/upload/vod/20241211-1/db06275ca5516e13fe057dd5503269b2.jpg', 'hop-nhac-jason-isbell-nham-mat-ma-chay', 'completed', 'https://phimimg.com/upload/vod/20241211-1/263d24fc1cda67a251f7817443377f50.jpg', '98 phút', 'single', 1000, 2023),
(80, 'Bộ phim tài liệu khám phá cách mà động lực của một con người thông thái, ngạo mạn và kiên quyết đã làm thay đổi bản chất của chiến tranh mãi mãi.', 'Full', '1', '2024-12-12 21:33:44.000000', 'Để Kết Thúc Mọi Cuộc Chiến Oppenheimer Và Bom Nguyên Tử', 'To End All War Oppenheimer And The Atomic Bomb', 'https://phimimg.com/upload/vod/20241211-1/35d766a11362776ba900653f2a92d744.jpg', 'e-ket-thuc-moi-cuoc-chien-oppenheimer-va-bom-nguyen-tu', 'completed', 'https://phimimg.com/upload/vod/20241211-1/9f3b8e6fae3e17786f445e079f0fcf00.jpg', '88 phút', 'single', 1000, 0),
(81, 'Bộ phim tài liệu về quá trình thực hiện cũng như những tác động của vở nhạc kịch có tên Xếp Hạng - vốn là tác phẩm của một trường trung học, lên đời sống xã hội Mỹ trong vấn đề gánh nặng kì vọng của phụ huynh đối với các em học sinh ngày nay.', 'Full', '1', '2024-12-12 21:33:44.000000', 'Cái Gọi Là Thứ Hạng Trường Trung Học Của Tôi', 'My So Called High School Rank', 'https://phimimg.com/upload/vod/20241211-1/3d5ff93f5382cc6d5b7c879a5ed5da1d.jpg', 'cai-goi-la-thu-hang-truong-trung-hoc-cua-toi', 'completed', 'https://phimimg.com/upload/vod/20241211-1/969ae156ec8b87d9220da4a88d9d7cac.jpg', '101 phút', 'single', 1000, 2022),
(82, 'Phim tài liệu về George Anthony Morton, một cựu tù nhân nay trở thành họa sĩ có tiếng, trở về quê nhà để đối diện với quá khứ bất hảo của chính mình.', 'Full', '1', '2024-12-12 21:33:44.000000', 'Bậc Thầy Ánh Sáng', 'Master Of Light', 'https://phimimg.com/upload/vod/20241211-1/a233922836c4194eab2f4e9832003c45.jpg', 'bac-thay-anh-sang', 'completed', 'https://phimimg.com/upload/vod/20241211-1/8db5f77cc65d258c67ddf3a40983aacc.jpg', '83 phút', 'single', 1000, 2022),
(84, 'Thuộc thể loại tâm lý-gia đình, bộ phim VieON Orginal - Tiểu Tam Không Có Lỗi? (đạo diễn: Trần Bửu Lộc, biên kịch: VieON) kể về 3 cô gái độc thân vô tình bước chân vào 3 gia đình dưới sự chỉ định của 3 người vợ, hòng che giấu các bí mật. Với góc nhìn đa chiều về chuyện ngoại tình, đây dự kiến là phim khai thác đề tài &quot;người thứ ba&quot; có nhiều cú twist đáng suy ngẫm nhất 2024.', 'Tập 12', '28', '2024-12-12 21:48:55.000000', 'Tiểu Tam Không Có Lỗi', 'Green Tea No Mistakes', 'https://phimimg.com/upload/vod/20241107-1/f8617084220368e9873072050d7f2222.jpg', 'tieu-tam-khong-co-loi', 'ongoing', 'https://phimimg.com/upload/vod/20241107-1/84a4bfc9f760c32e21737344f7459a05.jpg', '45 phút/tập', 'series', 100, 2024),
(85, 'Tần Xuyên, cùng hai người bạn thân là Diệp Mậu Sinh và Lý Văn, sau khi tốt nghiệp Học viện Cảnh sát đã mang theo giấc mơ trở thành anh hùng và cảnh sát hình sự quay về quê hương, trở thành những cảnh sát bình thường tại đồn công an địa phương. Tuy nhiên, khoảng cách lớn giữa thực tế và lý tưởng không khiến anh từ bỏ việc theo đuổi ước mơ của mình. Trong một lần tình cờ, Tần Xuyên tay không chế ngự một tên tội phạm đang âm mưu gây ra vụ nổ, mở ra bước ngoặt mới trong sự nghiệp cảnh sát hình sự của anh. Dưới sự dẫn dắt của cấp trên, anh dần trưởng thành và lần lượt phá được nhiều vụ án lớn gây chấn động cả nước.', 'Tập 33', '38', '2024-12-12 21:48:55.000000', 'Tôi Là Cảnh Sát Hình Sự', 'We Are Criminal Police', 'https://phimimg.com/upload/vod/20241128-1/f242457e3f121b85cd505877cc8aaffc.jpg', 'toi-la-canh-sat-hinh-su', 'ongoing', 'https://phimimg.com/upload/vod/20241128-1/141eb97ae755a183e67d97734ee28cc6.jpg', '45 phút/tập', 'series', 1000, 2024),
(86, 'Một cặp bố con có nhiều ngăn cách, nhờ việc xuyên không mà Lâm Tử Hào đã trở lại tuổi 18 của bố mình là Lâm Giai Húc, một thập kỷ 90 đầy cơ hội làm giàu. Tại đây, Lâm Tử Hào đã làm quen với một người bố hoàn toàn khác, thậm chí cả hai đã trở thành &quot;bạn chí cốt&quot;. Họ đã cùng nhau trải qua một tuổi trẻ nhiều biến động...', 'Tập 18', '24', '2024-12-12 21:48:55.000000', 'Tuổi 18 Của Tôi Và Bố', 'Engor Dreams At 18', 'https://phimimg.com/upload/vod/20241209-1/a7f8b3418d33920a1c9ae9987a710813.jpg', 'tuoi-18-cua-toi-va-bo', 'ongoing', 'https://phimimg.com/upload/vod/20241209-1/e3a0149c916c3e8967c6e4ede04dd074.jpg', '14 phút/tập', 'series', 0, 2024),
(87, 'Giới thiệu Thao Thiết Ký Thao Thiết Ký Giới thiệu Ở Thiên Hương Lâu của thành Vô Hạ, có một người là cô nương Châu Thành Bích- trưởng quầy xinh đẹp hoạt bát có tài nấu nướng, người còn lại là công tử thương gia Thường Thanh phất bút thành họa. Châu Thành Bích vốn tính ham ăn, dù là nguyên liệu nào cô cũng có thể biến thành món ăn ngon, ví như Giao Nhân Khoái, Hồ Nhãn Phong, Chưởng Gian Châu, Thiên Địa Xuân, Phù Dung Diệm, Vô Trường Công, Nấm Song Sinh, Đồng Tâm Tiêm, Mì Thiên Tê,... Mà những món ăn này cũng là sự vui buồn hợp tan của nhân gian, tình yêu, tình huynh đệ, tình phu thê, tình mẫu tử, nguy cơ của quốc gia thiên hạ... Trong quá trình hai người dây dưa với nhau, đã cùng trải qua nhiều chuyện. Tình cảm đến từ hai phía của họ chính là đích đến của vận mệnh, mối tình thâm này sinh ra từ đâu, nên đi về đâu đây ?', 'Tập 8', '40', '2024-12-12 21:48:55.000000', 'Thao Thiết Ký', 'The Legend Of Taotie', 'https://phimimg.com/upload/vod/20241210-1/5c0a8d803800a91bf8e0f57db92e4a2b.jpg', 'thao-thiet-ky', 'ongoing', 'https://phimimg.com/upload/vod/20241210-1/d8ffd9480c0b051d4b3e90abbcb360af.jpg', '45 phút/tập', 'series', 1000, 2024),
(88, 'Ca nữ Thẩm Tri Thu vì muốn khám phá sự thật về việc bị chị gái bỏ rơi năm xưa nên đã lên kế hoạch tỉ mỉ để tiếp cận cậu chủ nhà họ Doãn. Tuy nhiên, cô lại vô tình phải đính hôn với cậu ba Doãn Hành của nhà họ Doãn. Ở một gia đình đầy nguy hiểm như nhà họ Doãn, Thẩm Tri Thu và chị gái cứu lấy nhau và giải quyết mọi hiểu lầm. Đồng thời, cô và Doãn Hành từ mối quan hệ lợi dụng lẫn nhau đã dần dần yêu nhau thật lòng. Cuối cùng, cả hai cùng bắt tay thực hiện một màn trả thù hoành tráng.', 'Tập 10', '25', '2024-12-12 21:48:55.000000', 'Yêu Nhầm Song Sinh', 'Misplacement', 'https://phimimg.com/upload/vod/20241211-1/df13904e8d261e5abfaabc63dd2116be.jpg', 'yeu-nham-song-sinh', 'ongoing', 'https://phimimg.com/upload/vod/20241211-1/72c55a1ce3e866982ea3fe88003e21f6.jpg', '15 phút/tập', 'series', 1000, 2024),
(89, 'Bốn chàng tài tử nổi tiếng màn ảnh Hàn gồm Lee Je Hoon, Cha Eun Woo, Lee Dong Hwi và Kwak Dong Yeon sẽ &quot;di cư&quot; đến quê hương của ông già Noel ở Lapland, Phần Lan. Thử thách cuộc sống mới đầy thú vị với lối sống tự cung tự cấp của người bản địa, họ sẽ xoay xở thế nào khi mà đến cả điện và nước máy cũng là những thứ xa xỉ?', 'Tập 2', '10', '2024-12-12 22:04:17.000000', 'Lạc Lối Ở Phần Lan', 'Rented In Finland', 'https://phimimg.com/upload/vod/20241209-1/94493e358c9378062d7532e49becdb3d.jpg', 'lac-loi-o-phan-lan', 'ongoing', 'https://phimimg.com/upload/vod/20241209-1/38ab15572362f16b9d8da7fb890d75a4.jpg', '70 phút/tập', 'tvshows', 1000, 2024),
(90, 'Nghỉ ngơi sau khi đạo diễn các bộ phim bom tấn, Jon Favreau liên lạc với đầu bếp Roy Choi để khám phá thêm nhiều món ăn tuyệt vời và các đầu bếp tài năng đã tạo ra chúng.', 'Hoàn Tất (5/5)', '5', '2024-12-12 22:04:17.000000', 'Đầu bếp (Phần 4)', 'The Chef Show (Season 4)', 'https://phimimg.com/upload/vod/20241204-1/b00f0b8ff65d58d2cc590a7431c05414.jpg', 'dau-bep-phan-4', 'completed', 'https://phimimg.com/upload/vod/20241204-1/3880e6c9b7acf2b4207e510aff1593f0.jpg', '29 phút/tập', 'tvshows', 1000, 2020),
(91, 'Hành trình ẩm thực của Jon Favreau và Roy Choi tiếp tục đến Las Vegas, Los Angeles và xa hơn nữa khi họ phân tích và thưởng thức những công thức nấu ăn tuyệt vời.', 'Hoàn Tất (6/6)', '6', '2024-12-12 22:04:17.000000', 'Đầu bếp (Phần 3)', 'The Chef Show (Season 3)', 'https://phimimg.com/upload/vod/20241204-1/f23b5df478f886a42935035201e21928.jpg', 'dau-bep-phan-3', 'completed', 'https://phimimg.com/upload/vod/20241204-1/f0f20a7949fe354c27d37618ed3a23e7.jpg', '29 phút/tập', 'tvshows', 1000, 2020),
(92, 'Jon Favreau đổi chiếc ghế đạo diễn lấy tạp dề khi bước vào những cuộc phiêu lưu ẩm thực cùng Roy Choi, người bạn kiêm cố vấn ẩm thực của ông.', 'Hoàn Tất (6/6)', '6', '2024-12-12 22:04:17.000000', 'Đầu bếp (Phần 2)', 'The Chef Show (Season 2)', 'https://phimimg.com/upload/vod/20241204-1/7459261f0dd9b7b8b263ff8ebc194f25.jpg', 'dau-bep-phan-2', 'completed', 'https://phimimg.com/upload/vod/20241204-1/31e44b7b71f9fe6eb42509e6488cb530.jpg', '29 phút/tập', 'tvshows', 1000, 2019),
