(120, 'Teerak (Kong), một sinh viên năm nhất đại học đầy lạc quan, được các anh chị khóa trên đặt cho biệt danh mới là &quot;má chảy xệ&quot;. Một ngày nọ, tại một bữa tiệc, Teerak đồng ý uống rượu dù cho người bạn thân nhất cậu, Punlee khuyên anh không làm vậy. Trong khi Teerak say, một anh chàng cố gắng tán tỉnh cậu. Sau đó, chủ nhà hàng, Muenfah, anh trai của Punlee, đến giải cứu Teerak. Teerak say xỉn từ sau đó ngưỡng mộ Muenfah và dụ dỗ anh khi anh đưa cậu về nhà. Teerak cầu xin Muenfah hôn lên đầu mình, trong khi không biết rằng Muenfah đã thầm thích cậu một thời gian dài.', '', '', '2024-12-17 15:03:23.000000', 'Muôn Ngàn Trời Mây', 'Your Sky', 'https://phimimg.com/upload/vod/20241123-1/cd21c00b4def93202ceac6491ea90dcf.jpg', 'muon-ngan-troi-may', 'ongoing', 'https://phimimg.com/upload/vod/20241123-1/f14f2b3287f7b656cc3c87d3d55392ce.jpg', '45 phút/ tập', 'series', 1000, 2024),
(121, 'Phim khắc hoạ những nhiệm vụ hóc búa của lực lượng cảnh sát hình sự, thủ đoạn gây án tinh vi của các đối tượng có trí tuệ khác thường gây nên nhiều khó khăn trong quá trình điều tra. Bên cạnh sự đấu trí căng thẳng, kịch bản phim còn mang đến những cảnh quay hành động đẹp mắt, ấn tượng, khai thác bối cảnh độc đáo, hoang sơ, rùng rợn. Bộ phim là tác phẩm tâm huyết của Điện ảnh CAND cùng tất cả ekip sản xuất, hứa hẹn sẽ mang đến cho khán giả những phút giây theo dõi, trải nghiệm hấp dẫn nhưng cũng mang ý nghĩa giá trị nhân văn sâu sắc.', '', '', '2024-12-17 15:09:37.000000', 'Đội Điều Tra Số 7 (Phần 2) : Gương Mặt Vặn Vẹo', 'Investigation Team No. 7 (Season 2) : Twisted Face', 'https://phimimg.com/upload/vod/20241217-1/58cdaf811fad4513de17f40ff07486f5.jpg', 'doi-dieu-tra-so-7-phan-2-guong-mat-van-veo', 'ongoing', 'https://phimimg.com/upload/vod/20241217-1/299cc9528266c12d0124041d741e153d.jpg', '45 phút/ tập', 'series', 1000, 2024),
(122, 'Hải Hà dậy sóng, thiên đoàn Tân Môn một lần nữa xuất hiện, Cửu Ngưu, Nhị Hổ, Nhất Kê xuất hiện, thần sông trừ ma, diệt yêu quái dưới nước. Cách xa ba năm, tiểu đội năm nào giờ tiếp tục với tám vụ án kỳ lạ thời Dân Quốc! Hãy cứ chờ đón!', '', '', '2024-12-17 15:15:11.000000', 'Hà Thần 2', 'Tientsin Mystic 2', 'https://phimimg.com/upload/vod/20241206-1/2b03cb0ded9a93f357c6af59d3e25d92.jpg', 'ha-than-2', 'completed', 'https://phimimg.com/upload/vod/20241206-1/d0e84bf2b3a5fae2b55557c6456bbf30.jpg', '45 phút/ tập', 'series', 1000, 2020),
(123, 'Vào những năm dân quốc, Thiên Tân liên tục xảy ra lũ lụt, những câu chuyện về thế lực thần bí dưới sông không ngừng xuất hiện. Đội trưởng đội cảnh sát sông Quách Đắc Hữu được nhận chân truyền của sư phụ là “Lão Hà Thần”, nhờ tuyệt kĩ bật lửa giải oan, an ủi được vô số oan hồn. Hội trưởng thương hội vận chuyển đường thủy Lý Kỳ chết dưới sông. Quách Đắc Hữu bị hiềm nghi, cùng với con trai hội trưởng là Đinh Mão, thanh mai trúc mã Cố Ảnh và con gái thư ký trưởng ủy ban thành phố Thiên Tân -Tiêu Lan Lan cùng điều tra vụ án, phát hiện tất cả những hiện tượng kì lạ đều hướng về 1 câu chuyện từ 20 năm trước. Hồi ấy có một tổ chức tà giáo tên “Ma Cổ Đạo” hoành hành khắp khu vực Bắc Kinh và Hà Bắc. 20 năm sau, Quách Đắc Hữu và Đinh Mão lại lần nữa phát hiện dấu vết của “Ma Cổ Đạo”. Bốn người Quách Đắc Hữu, Đinh Mão, Cố Ảnh, Tiêu Lan Lan vì ngăn chặn sự khôi phục của Ma Cổ Đạo mà bị cuốn vào từng vụ án ly kỳ hấp dẫn.', '', '', '2024-12-17 15:19:33.000000', 'Hà Thần', 'Tientsin Mystic', 'https://phimimg.com/upload/vod/20241206-1/22ae46e2b1ba2d77047275b66f7ce84b.jpg', 'ha-than', 'completed', 'https://phimimg.com/upload/vod/20241206-1/50a927d831ce53e75d73da1993463ef6.jpg', '45 phút/ tập', 'series', 1000, 2020),
(124, 'Góc Khuất Của Bí Mật kể về Trương Đông Thăng là giáo viên phương Bắc xuống ở rể ở phương Nam. Người vợ ngoại tình và muốn ly hôn, ngay cả cha mẹ vợ cũng khuyên anh ta nên buông tay. Trương Đông Thăng giả vờ mời bố mẹ vợ đi leo núi. Khi đến đỉnh núi, anh ta tìm cách đẩy họ xuống vực. Ba đứa trẻ Chu Triều Dương, Phổ Phổ, Đinh Hạo vô tình chứng kiến và quay lại cảnh Trương Đông Thăng giết cha mẹ vợ. Vì Phổ Phổ cần tiền để chữa bệnh cho em trai nên ba đứa trẻ lên kế hoạch tống tiền Trương Đông Thăng. Sau đó liên tục xảy ra nhiều cái chết bí ẩn. Chu Triều Dương là học sinh có thành tích học tập xuất sắc nhất toàn trường cấp 2. Mạch chuyện thêm kịch tính khi Chu Triều Dương vô tình ngộ sát em gái cùng cha khác mẹ, Phổ Phổ và Đinh Hạo chứng kiến sự việc. Sự việc đẩy đưa biến Chu Triều Dương trở thành Trương Đông Thăng thứ hai.', '', '', '2024-12-17 15:23:53.000000', 'Góc Khuất Của Bí Mật', 'The Bad Kids', 'https://phimimg.com/upload/vod/20241206-1/f6159baf78a6a5a8766c3734275f78cf.jpg', 'goc-khuat-cua-bi-mat', 'completed', 'https://phimimg.com/upload/vod/20241206-1/52cf6f577813efad985458438b79605f.jpg', '45 phút/ tập', 'series', 1000, 2020),
(125, 'Baek Ho Rang (Jung Da Bin thủ vai) với sự nổi tiếng ở trong thời kỳ đỉnh cao nên không xem ai ra gì và để tìm ra kẻ nặc danh đã vạch trần quá khứ của mình mà vào làm trong đài truyền hình của Go Eun Taek (Hwang Min Hyun đảm nhận). Live On lúc này mở ra một câu chuyện hài hước lãng mạn. Được biết Go Eun Taek vốn là người nhạy cảm, tinh tế và đôi lúc trở nên cáu kỉnh muốn mọi kế hoạch của mình phải thật hoàn hảo. Dù là một người khó tính và không mấy linh hoạt khi bàn chuyện lãnh đạo, nhưng Eun Taek chưa bao giờ né tránh công việc và được yêu thích bởi các bạn học của mình.', '', '', '2024-12-17 15:28:05.000000', 'Ký Ức Tuổi 18', 'Live On', 'https://phimimg.com/upload/vod/20241206-1/96e55823c3d0e2b0f7913d29ed67ab44.jpg', 'ky-uc-tuoi-18', 'completed', 'https://phimimg.com/upload/vod/20241206-1/d91e3109241f7714637688321c06c573.jpg', '45 phút/ tập', 'series', 1000, 2021),
(126, 'Phim xoay quanh hành trình tìm kiếm những thi thể mất tích và khám phá sự thật đằng sau tại một ngôi làng lưu giữ linh hồn của họ.\\r\\n\\r\\nKim Wook điển trai và kiếm sống bằng nghề lừa đảo, luôn biết cách thuyết phục đối tác của mình. Một ngày nọ, anh tình cờ đến ngôi làng Duon và phát hiện ra nhiều điều bí ẩn tại đây, nơi tập trung những người mất tích bị chết. Jang Pan Seok đang bí mật điều tra, anh chính là sợi dây kết nối giữa ngôi làng vào thế giới bên ngoài. Hai người gặp nhau và trở thành đối tác, họ cùng với nữ hacker Lee Jong Ah và thám tử trẻ tuổi Shin Joon Ho bắt tay giải quyết các vụ án.', '', '', '2024-12-17 15:31:58.000000', 'Mặt Trái Của Mất Tích', 'Missing: The Other Side', 'https://phimimg.com/upload/vod/20241206-1/3ff071d59ef7e6e98f1692e17d099462.jpg', 'mat-trai-cua-mat-tich', 'completed', 'https://phimimg.com/upload/vod/20241206-1/fa4cdfdd0491cb85ba5bab6f5af0b91c.jpg', '45 phút/ tập', 'series', 1000, 2022),
(127, 'En Of Love: TOSSARA (Kỹ Sư Tình Yêu) xoay quanh mối quan hệ của ba cặp đôi đều là các sinh viên kỹ thuật và y tế. Gun Tossakan là một sinh viên khoa y khoa rất điển trai Gun đã phải lòng Bar Sarawat, học khoa Kỹ Thuật từ khi học trung học. Nhưng khi ấy Gun không thể thổ lộ tình cảm của mình vì lời hứa mà anh đã hứa với mẹ mình rằng cậu sẽ không hẹn hò cho đến khi thi đỗ Đại học. Định mệnh thay, Gun và Bar học chung trường Đại học và câu chuyện của họ bắt đầu từ đây...', '', '', '2024-12-17 15:36:23.000000', 'Kỹ Sư Tình Yêu', 'En of Love', 'https://phimimg.com/upload/vod/20241206-1/97d8a694f9ca071b474ce70d640f56b8.jpg', 'ky-su-tinh-yeu', 'completed', 'https://phimimg.com/upload/vod/20241206-1/58ce508f0adde2585011013678f2774a.jpg', '45 phút/ tập', 'series', 1000, 2020),
(128, 'Câu chuyện sinh tồn xoay quanh một biệt đội chuyên săn lùng và chiến đấu với quái vật. Krystal sẽ vào vai nữ chính Son Ye Rim - một nữ sĩ quan quân đội mẫn cán, quả cảm và đặc biệt &quot;trên thông thiên văn, dưới tường địa lý&quot; có kiến thức trong rất nhiều lĩnh vực. Trong khi đó, nam chính Yoon Dong Jin (Jang Dong Yoon) là một lính tại ngũ có chuyên môn huấn luyện chó cảnh sát chuyên nghiệp, dù chỉ còn một tháng nữa là đến ngày xuất ngũ nhưng bất ngờ gặp rắc rối khi một chó cảnh sát do anh phụ trách đã &quot;xổng trại&quot;. Anh chàng liền bị điều đến một đơn vị khác và sẽ phải hợp tác cùng nữ chính để truy lùng và đối phó với một con &quot;quái vật&quot;', '', '', '2024-12-17 15:41:24.000000', 'Truy Tìm', 'Search', 'https://phimimg.com/upload/vod/20241206-1/96d2a13e5ec3537326e9754c981f8fac.jpg', 'truy-tim', 'completed', 'https://phimimg.com/upload/vod/20241206-1/da40da87f7d9b52294127ea7e14347f5.jpg', '45 phút/ tập', 'series', 1000, 2020),
(129, 'Bộ phim kể câu chuyện lãng mạn, bí ẩn về các nhân vật chính có được IQ cao nhờ thí nghiệm, nhưng đồng thời cũng mất đi tình cảm. Họ cùng nhau điều tra một vụ việc bí ẩn, cùng chống lại những âm mưu quyền thế, truy tìm chân tướng. Nam Goong Min vào vai một điều tra viên tài ba, phát hiện ra sự việc hiện tại có liên quan tới vụ án 26 năm trước. Đây là nhân vật then chốt để tìm kiếm ra manh mối sự việc. Kim Seol Hyun đóng vai nữ cảnh sát xinh đẹp có thiên phú, miệt mài truy tìm, là người gánh việc đánh nhau, uống rượu trong đội. Lee Chung Ah đóng vai điều tra viên của FBI. Yoon Sun Woo đóng vai kỹ sư thần bí chấp hành nhiệm vụ bí mật.', '', '', '2024-12-17 15:45:34.000000', 'Thức Tỉnh', 'Awaken', 'https://phimimg.com/upload/vod/20241206-1/9112fbf30daf3335cc96b6656cda01aa.jpg', 'thuc-tinh', 'completed', 'https://phimimg.com/upload/vod/20241206-1/e35e100ea019507ad393893885b624a6.jpg', '45 phút/ tập', 'series', 1000, 2022),
(130, 'Giáng sinh sắp đến cũng là lúc Colt, Beau cùng cả gia đình nâng ly và nói lời tạm biệt khi loạt phim đến hồi kết.', '', '', '2024-12-17 15:53:26.000000', 'Trang Trại (Phần 8)', 'The Ranch (Season 8)', 'https://phimimg.com/upload/vod/20241206-1/f0ab9278b085af91d8c7b7fcff87066b.jpg', 'trang-trai-phan-8', 'completed', 'https://phimimg.com/upload/vod/20241206-1/7385963f53248f4f33582b5718ccb82f.jpg', '45 phút/ tập', 'series', 1000, 2020),
(131, 'Colt đối mặt với khó khăn của việc điều hành trang trại khi anh và Abby chuẩn bị làm cha mẹ. Thêm một nhân vật sắp xuất hiện khiến nhà Bennett luôn trong tư thế sẵn sàng.', '', '', '2024-12-17 15:58:13.000000', 'Trang Trại (Phần 6)', 'The Ranch (Season 6)', 'https://phimimg.com/upload/vod/20241206-1/65a8e1d8ccd23210eddd4cd9ba893416.jpg', 'trang-trai-phan-6', 'completed', 'https://phimimg.com/upload/vod/20241206-1/36f835f712a0e13e2cdc6170a8be1b33.jpg', '45 phút/ tập', 'series', 1000, 2024),
(132, 'Từ hầm ngục rock n roll bí mật cho đến spa đẳng cấp khác, nhà thiết kế Melanie Rose nghĩ cách đại tu phòng yêu cho các cặp đôi trong chương trình thực tế táo bạo này.', '', '', '2024-12-17 16:02:03.000000', 'Cách Xây Dựng Phòng \'Yêu\'', 'How To Build A Sex Room', 'https://phimimg.com/upload/vod/20240205-1/6bb1b79aadc374ca9ead4adda8adfcc5.jpg', 'cach-xay-dung-phong-yeu', 'completed', 'https://phimimg.com/upload/vod/20240205-1/53c39f4ff4b92d85c2dfa61b96efe9f8.jpg', '45 phút/ tập', 'tvshows', 1000, 2020),
