(134, 'Trong cuộc thi này do Niska, Shay và SCH làm giám khảo, một nhóm nghệ sĩ mới đầy tham vọng cạnh tranh giành giải thưởng 100.000 euro cũng như nổi tiếng trong cộng đồng rap Pháp.', '', '', '2024-12-17 16:11:22.000000', 'Nhịp Điệu Hip Hop: Pháp (Phần 2)', 'Rhythm + Flow France (Season 2)', 'https://phimimg.com/upload/vod/20240126-1/9412b0f7a292f3d6ebf20a141e5d20e3.jpg', 'nhip-dieu-hip-hop-phap-phan-2', 'completed', 'https://phimimg.com/upload/vod/20240126-1/0103d4060d9976fd61d22b1bb4298a3f.jpg', '45 phút/ tập', 'tvshows', 1000, 2020),
(135, 'Lần này, Gordon chiêu mộ những người trẻ đầy triển vọng. Mười tám thí sinh từ 24 tuổi trở xuống sẽ tập trung ở Las Vegas để cạnh tranh vị trí bếp trưởng.', '', '', '2024-12-17 16:17:39.000000', 'Nhà Bếp Địa Ngục (Phần 20)', 'Hell\'s Kitchen (Season 20)', 'https://phimimg.com/upload/vod/20240116-1/a76d4c4396caa8bb9eef95408a628f1a.jpg', 'nha-bep-dia-nguc-phan-20', 'completed', 'https://phimimg.com/upload/vod/20240116-1/6c693de170c417323f05ccac8d0689a9.jpg', '45 phút/ tập', 'tvshows', 1000, 2020),
(136, 'Yuzaki Hoshizora (Nasa) đã dính tình yêu sét đánh với cô gái xinh đẹp bí ẩn Tsukasa. Một cặp đôi hài hước hạnh phúc với tình yêu, một cuộc sống mới cưới dễ thương và đáng quý bắt đầu!', '', '', '2024-12-18 09:02:10.000000', 'Dù Sao Cũng Dễ Thương (Mùa 1)', 'Tonikaku Kawaii (Season 1)', 'https://phimimg.com/upload/vod/20241202-1/fb7b7891ff7c0a5d095fd7b645a70435.jpg', 'du-sao-cung-de-thuong-mua-1', 'completed', 'https://phimimg.com/upload/vod/20241202-1/390eea620a4819fe8cf2f0b51a0dbb22.jpg', '25 phút/tập', 'hoathinh', 1000, 2020),
(137, 'Chàng trai đã yêu cô gái bí ẩn và xinh đẹp ngay từ cái nhìn đầu tiên. Trước lời tỏ tình của anh, câu trả lời của cô là &quot;Nếu anh bằng lòng lấy em, thì em sẽ hẹn hò với anh&quot;? !', '', '', '2024-12-18 09:06:41.000000', 'Dù Sao Cũng Dễ Thương (Mùa 2)', 'Tonikaku Kawaii (Season 2)', 'https://phimimg.com/upload/vod/20240308-1/e1102578727e54e36b704c72aa6337cf.jpg', 'du-sao-cung-de-thuong-mua-2', 'completed', 'https://phimimg.com/upload/vod/20240308-1/363e8f272a5ef5a8999b077eaf1be280.jpg', '25 phút/tập', 'hoathinh', 1000, 2021),
(138, 'Đột nhiên, Fei Xingkong và Si Rui phát hiện ra rằng họ bị giam trong một chiếc lồng truyện tranh. Mong muốn của họ là được trở lại thế giới thực. Nhưng trong thế giới của những câu chuyện không ngừng thay đổi, họ buộc phải thoát khỏi sự kiểm soát hoàn toàn của “tác giả”…', '', '', '2024-12-18 09:12:29.000000', 'Người Trong Lồng', '    \"origin_name\": \"CAGED CHARACTER\",', 'https://phimimg.com/upload/vod/20241001-1/128866a1dfaf60119e170c5c9d5c7ef7.jpg', 'nguoi-trong-long', 'ongoing', 'https://phimimg.com/upload/vod/20241001-1/92b86f0ae9a2181d944475e50daa7863.jpg', '25 phút/tập', 'hoathinh', 1000, 2024),
(139, 'Trong Hậu cung thời Edo, hai người mới đến phát hiện ra âm mưu chính trị, sự ganh đua và một linh hồn báo thù mà chỉ một Dược Phu lang thang mới có thể chế ngự được.', '', '', '2024-12-18 09:16:59.000000', 'Mononoke Phim Điện Ảnh: Bóng Ma Trong Mưa', 'Mononoke the Movie: The Phantom in the Rain', 'https://phimimg.com/upload/vod/20241201-1/cda3b6ae02188a078e9cadbf2eb7aa5f.jpg', 'mononoke-phim-dien-anh-bong-ma-trong-mua', 'completed', 'https://phimimg.com/upload/vod/20241201-1/0c5668890b4f92dc2af3961b4033856d.jpg', '25 phút/tập', 'hoathinh', 1000, 2023);
